pragma solidity 0.8.18;

contract numberFunction {

    address public owner;

    uint256 number;
    uint256 otherNumber;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not Permitted");
        _;
    }

    function setNumber(uint256 _number) external onlyOwner {
        number = _number;
    }

    function setNumbers(uint256 number1, uint256 number2) external onlyOwner {
        number = number1;
        otherNumber = number2;
    }

    function setNumbersBool(uint256,bool,uint256) external onlyOwner {

    }

}
